import './App.css';
import ModalPersona from './ModalPersona.js'
import * as React from 'react';
import Button from '@mui/material/Button';

function App() {
  return (
    <div>
      <Button variant="outlined">Asignar Persona</Button>
      <ModalPersona></ModalPersona>
    </div>
  );
}

export default App;
